description:
Season 3, Episode 9 -- original air date (Dec. 13th - Teletoon)

&quot;Witness Protection&quot;

Bob&amp;#039;s quote: &quot;Why can&amp;#039;t I stop thinking about t*ts?&quot;

Parodies: The TV show &quot;Desparate Housewives&quot;

Summary: Chode is picked up for shoplifting, but Commander Adam is only using him to get to Darth Bobo. To keep Chode safe, Adam sends him off to a far away planet in the witness protection program. On the planet, four housewives, desparate for sex, all try to compete to get Chode.
